$(function() {

  (function($, window, undefined) {

    'use strict';

    APP.Modules.Eggs = (function() {

      var elements = {
        panel:  $('.panel-eggs'),
        eggList: $('.panel-eggs .egg-list')
      };

      var icons = {
        egg: 'data:image/png;base64,',
        egg_hatch: 'data:image/png;base64,'
      };

      return {

        eggList: [],

        init: function() {

          console.log('Eggs Module Initialized');

          APP.Utils.insertLoading(elements.panel);

          /* ================
           SOCKET LISTENING
           ================ */
          socket.on('eggs', function(data){

            APP.Modules.Eggs.eggList = data.eggs;

            elements.eggList.html('');

            for (var i = 0; i < data.eggs.length; i++) {

              var egg = data.eggs[i];
              var popOver = '<p><strong>Target: </strong>' + egg.distanceWalked.toFixed(1) + '/' + egg.distanceTarget + ' Km</p>';
              var displayIcon;
              
              if (egg.distanceWalked !== 0.0) {
                displayIcon = icons.egg_hatch;
              } else {
                displayIcon = icons.egg;
              }
              
              var elem = $('<span class="col-sm-4 col-lg-3"><img class="media-object img-thumbnail center-block" src="' + displayIcon + '" alt="' +
                  egg.distanceTarget + '" /></span>').popover({
                title: 'Egg',
                html: true,
                placement: 'top',
                content: popOver,
                trigger: 'hover'
              });
              elements.eggList.append(elem);

            }

            APP.Utils.removeLoading(elements.panel);

          });

        }

      };

    }());


  })(jQuery, window);

});